import React from 'react';
import styles from './users.module.css';

let Users = (props) => {
    return <div>
        {
            props.users.map(u => <div key={u.id}>
                <span>
                    <div>
                        <img className={styles.user_photo} src={u.photo_url}/>
                    </div>
                </span>
                    <span>
                    {u.full_name}
                        <div>{u.status}</div>
                </span>
                    <span>
                    {u.followed ? <button onClick={() => {
                            props.unfollow(u.id)
                        }}>Unfollow</button>
                        : <button onClick={() => {
                            props.follow(u.id)
                        }}>Follow</button>}
                </span>
                    <span>
                    <div>{u.location.city}</div>
                    <div>{u.location.country}</div>
                </span>
                </div>
            )
        }
    </div>
}
export default Users;
